import React from 'react'
import Stack from '@mui/material/Stack';
import { Typography } from '@mui/material';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';

const PortfolioBox = ({url,img,title,description,tech}) => {
  return (
    <>
      <a href={url} style={{ textDecoration: 'none' }}>
        <Box 
          sx={{
            backgroundColor:"#FFFFFF",
            borderRadius:"16px",
            padding:"24px",
            cursor:"pointer",
            transition: "all 0.2s ease-in-out",
            '&:hover': {
            backgroundColor: "#E5E6E6",
            transform: "scale(1.05)",
            '& img': {
            transform: "rotate(340deg)"
          }
        }
          }}>
              <Stack spacing={2}>
                <Stack direction="row" spacing={1}>
                  <img alt="logoimage" width="24px" height="24px" src={img}></img>
                  <Typography sx={{fontSize:"18px",fontFamily:'Inter',fontWeight:"800",color:"#1F2836"}}>{title}</Typography>
                </Stack>
                <Typography sx={{fontSize:"16px",fontFamily:'Inter',fontWeight:"regular",color:"#4D545E"}}>{description}</Typography>
               </Stack>
               <Typography sx={{fontSize:"13px",fontFamily:'Inter',fontWeight:"regular",color:"#4D545E"}}>{tech}</Typography>
            </Box>
      </a>


    </>
  )
}

export default PortfolioBox
